import React from "react";
import { CurrencyLabel } from "@skbkontur/react-ui";
import { Vehicle, vehicleTypeTitles } from "../data/vehicles/contracts";

interface TableItem1 {
  vehicle: Vehicle;
  number: number;
}

const TableItem: React.FC<TableItem1> = ({ vehicle, number }) => {
  return (
    <tr>
      <td>{number}</td>
      <td>{vehicle.title}</td>
      {/* <td>{vehicleTypeTitles}</td> */}
      <td>
        <CurrencyLabel value={vehicle.price} fractionDigits={2} />
      </td>
    </tr>
  );
};

interface Table1 {
  vehicles: Vehicle[];
}

export const Table: React.FC<Table1> = ({ vehicles }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>#</th>
          <th>Название</th>
          <th>Цена, ₽</th>
          <th>ТС одним словом</th>
        </tr>
      </thead>
      <tbody>
        {vehicles.map((x: Vehicle, i: number) => (
          <TableItem key={x.id} number={i + 1} vehicle={x} />
        ))}
      </tbody>
    </table>
  );
};
